import React, { useState } from 'react'
import { Link } from 'react-router-dom';

export default function Home() {
  const [News] =useState({})
  return (
    <div>
      <h1>Home组件内容,携带参数给News组件</h1>
      <h3>
        <Link to="news">News</Link>
      </h3>
      <h3>
        <Link to="message">Message</Link>
      </h3>
    </div>
  )
}
